// src/pages/SurgeryPage/SurgeryHeader.jsx

import React from 'react';
import './Surgery.css';
import backgroundImage from '../../assets/SurgeryPage/back.png';
import { FaPhoneAlt } from 'react-icons/fa';

const SurgeryHeader = () => {
  return (
    <div className="surgery-header-container">
      <div className="surgery-header-image-wrapper">
        <img src={backgroundImage} alt="Surgery Header" className="surgery-header-image" />
        <div className="surgery-header-content">
          <h3 className="header-title">AyuRaksha</h3>
          <h1 className="header-heading">
            End to end care from Top Surgeons at our AyuRaksha Care Clinics
          </h1>
          <p className="header-subtext">
            Talk to our care expert today to book your consultation.
            <br />
            All insurance accepted & No-cost EMI available.
          </p>
          <div className="call-box">
            <p>Reach out to us on</p>
            <div className="call-line" />
            <div className="call-info">
              <FaPhoneAlt className="call-icon" />
              <span>08045685554</span>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default SurgeryHeader;
